+            case UTF8 -> out.writeUTF(utf8DebugExtension.toString());
+            case BYTE -> out.write(toByteArray(byteDebugExtension));
+            default -> throw new RuntimeException("SourceDebugExtension_attribute is not initialized");
+        }
+        ;
+    }
